  <script>
    let path = window.location.pathname.split('/');
    if (path.length > 0) {
      if (!path[0]) {
        path = path.slice(1, path.length);
      }
      path = path.slice(0, path.length - 1);
    }

    let base = '/';
    for (const segment of path) {
      base = base + segment + '/';
    }

    document.write('<base href="' + base + '">');
  </script>
